(function () {
	'use strict'

	let autoRemoveELement = true; 
	let defaultDJ = 1;
	
	// 初始化等级
	const dj = GM_getValue('dengji'); 
	dj ? (defaultDJ = +dj) : GM_setValue('dengji', defaultDJ); 

	const menu = [
		{ key: 'setButton',   name: '设置参数', value: true, showNotification: true, tip: { open: '👈', close: '👉' }, click: settingPars },
		{ key: 'showSetIcon', name: '显示图标', value: true, showNotification: true, tip: { open: '✅', close: '❌' }, click: showIcon },
		{ key: 'setHuijue',   name: '设置慧觉', value: true, showNotification: true, tip: { open: '👈', close: '👉' }, click: set_huijue }
	]
	// 保存已注册的菜单
	const munuRegister = []
	// 配置默认菜单
	menu.forEach(v => { if (GM_getValue(v.key) === undefined || GM_getValue(v.key) === null) GM_setValue(v.key, v.value) })

	// 注册菜单
	function registerMenuCommand() {
		if (munuRegister.length === menu.length) { munuRegister.forEach(v => { GM_unregisterMenuCommand(v) }) }
		menu.forEach((v, i) => {
			v.value = GM_getValue(v.key)
			munuRegister[i] = GM_registerMenuCommand(`${v.value ? v.tip.open : v.tip.close} ${v.name}`, () => { menuSwitch(v) })
		})
	}

	// 切换菜单
	function menuSwitch(item) {
		// 设置数据
		item.value = !item.value
		GM_setValue(item.key, item.value)
		// 系统通知
		if (item.showNotification) {
			GM_notification({
				text: `已${item.value ? item.tip.open : item.tip.close}[${item.name}] 功能`,
				title: '设置',
				timeout: 1000
			})
		}
		// 重新注册
		registerMenuCommand()
		// 如果有点击事件，执行
		if (item.click) item.click()
	}
	// 注册菜单
	registerMenuCommand()

	function settingPars() {

	}

	function showIcon() {
		// if(e.value) {
		var is2showIcon = GM_getValue('showSetIcon'); 
		if(is2showIcon) {
			scrollContainer.style.display = 'block'
		} else {
			scrollContainer.style.display = 'none'
		}
		// GM_setValue('showSetIcon', is2showIcon);
	}

	//============================
	function setPlatform() {
		// 将平台设置为安卓 
		Object.defineProperty(navigator, 'platform', { get: function () { return 'Android'; } });

		// 将浏览器设置为Android
		// const customUserAgent = 'Mozilla/5.0 (Linux; Android 11; M2102J20SG) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/97.0.4692.99 Mobile Safari/537.36 EdgA/97.0.1072.78';
		const customUserAgent = 'Mozilla/5.0 (Linux; U; Android 7.0; zh-CN; PRO 7-S Build/NRD90M) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/57.0.2987.108 UCBrowser/11.9.4.974 UWS/2.13.2.46 Mobile Safari/537.36 AliApp(DingTalk/4.6.29) com.alibaba.android.rimet/11388461 Channel/10002068 language/zh-CN';
		Object.defineProperty(navigator, 'userAgent', {
			value: customUserAgent,
			writable: false
		});
	}

	// 移除提示小窗口
	function removeSweetAlerts() {
		// debugger;
		let list = document.querySelectorAll('.sweet-alert');
		for (let index = 0; index < list.length; index++) {
			let item = list[index];
			item.remove();
		}
	}

	// 移除透明的全页面遮罩元素
	function removeSweetOverlay() {
		// debugger;
		let list2 = document.querySelectorAll('.sweet-overlay');
		for (let index = 0; index < list2.length; index++) {
			let item = list2[index];
			item.remove();
		}
	}

	function removebodyscript() {
		var body = document.body;
		var list = body.querySelectorAll('script');
		for (let index = 0; index < list.length; index++) {
			var item = list[index];
			// console.log(item);
			var text = item.innerHTML 
			if (text.indexOf('swal') !== -1 ) item.remove();
		}
	}

	function delBodyAttributes(){
		var body = document.body;		
		body.removeAttribute('onselect');
		body.removeAttribute('onselectstart');
		body.removeAttribute('oncopy');
		body.removeAttribute('onbeforecopy');
		body.removeAttribute('onmouseup');
	}

	function backURL(){
		let oldurl = window.location.href;
		let newurl = oldurl;
		if (newurl.indexOf('jieduan.php') !== -1) {
			var str = newurl.split('leixing='); 
			if(str[1]=='nl') newurl = 'https://brainpassword.online/indexxiangm.html'; 
			if(str[1]=='sd') newurl = 'https://brainpassword.online/sdindexxiangm.html'; 
			if(str[1]=='jy') newurl = 'https://brainpassword.online/jyindexxiangm.html'; 
		} else if (newurl.indexOf('denglu.php') !== -1) {
			var str = newurl.split('leixing='); 
			if(str[1]=='nl') newurl = 'https://brainpassword.online/indexxiangm.html'; 
			if(str[1]=='sd') newurl = 'https://brainpassword.online/sdindexxiangm.html'; 
			if(str[1]=='jy') newurl = 'https://brainpassword.online/jyindexxiangm.html'; 
		}

		if (oldurl !== newurl) window.location.href = newurl;
	}

	function setUrl_Dengji() {
		let oldurl = window.location.href;
		let newurl = oldurl;

		if (newurl.indexOf('dengji=') !== -1) {
			newurl = newurl.replace(/dengji=\d+/g, 'dengji=' + defaultDJ); //将地址替换成相应的训练等级
		}
		if (newurl.indexOf('xingxnl') !== -1) {
			// newurl = newurl.replace(/xingxnl\d+/g, 'xingxnl' + defaultDJ); //将地址替换成相应的训练等级
		}
		if (newurl.indexOf('xingxjy') !== -1) {
			// newurl = newurl.replace(/xingxjy\d+/g, 'xingxjy' + defaultDJ); //将地址替换成相应的训练等级
		}

		if (newurl.indexOf('sfkzlx') !== -1) {
			if (defaultDJ == 1) {
				// newurl = newurl.replace(/sfkzlx*/g, 'sfkzlx.php');
				// newurl = 'https://brainpassword.online/sfkzlx.php';
			} else {
				// newurl = newurl.replace(/sfkzlx*/g, 'sfkzlx' + defaultDJ + '.php');
				// newurl = 'https://brainpassword.online/sfkzlx'+defaultDJ+'.php';
			}
		}

		if (newurl.indexOf('younaoqidong') !== -1) {
			if (defaultDJ == 1) {
				// newurl = newurl.replace(/younaoqidong*/g, 'younaoqidonglx.php');
				// newurl = 'https://brainpassword.online/younaoqidonglx.php';
			} else {
				// newurl = newurl.replace(/younaoqidong*/g, 'younaoqidong' + defaultDJ + '.php');
				// newurl = 'https://brainpassword.online/younaoqidong'+defaultDJ+'.php';
			}
		}
		if (oldurl !== newurl) window.location.href = newurl;
	}

	// 给当前页面添加一个元素sfjibie
	function addElexxjy() {
		let url = window.location.href;
		if (url.indexOf('xxjy') !== -1 || url.indexOf('xinxiang') !== -1 || url.indexOf('younaoqidong') !== -1 || ('sfkz') !== -1) {
			// 如果当前页面为形象记忆训练，同需要添加一个元素 sfjibie 元素 
			const element = document.createElement('div')
			element['id'] = 'sfjibie';
			element.value = defaultDJ;
			document.body.appendChild(element);
		}
	}
	
	async function autoRemove(){
		removeSweetAlerts(); 
		removeSweetOverlay(); 
		set_huijue(); 
		setTimeout(2e3);
	}

	backURL(); 
	// 当前页面地址中有等级信息，则将其修改为相应的等级 
	// if(window.location.href.indexOf('dengji=0') !== -1) setUrl_Dengji(); 
	setUrl_Dengji(); 
	setPlatform(); 
	removebodyscript(); 

	addElexxjy(); 
	if (document.body !== null) {
		removebodyscript(); 
		// autoRemove(); 
		removeSweetAlerts(); 
		removeSweetOverlay(); 
	}
	delBodyAttributes(); 

	// autoRemove(); 
	// async (()=>{
	// 	setTimeout(2000); 
	// 	autoRemove(); 
	// }); 

	// 如果是慧觉训练页面 
	function set_huijue(){
		if (window.location.href.indexOf('huijue.php') !== -1 ) {
			// document.getElementById('shuoming').onload = function () {
			// }
			let body = document.getElementById('shuoming').contentWindow.document.body;
			
			let list2 = body.querySelectorAll('.iframe_link');
			for (let index = 0; index < list2.length; index++) {
			  let item = list2[index];
			  var url = item.href; 
			  var str = url.match(/xinxi=.*/);
			  if( str.length>0 && str[0] === 'xinxi=') {
				url = url+'gfjyklddgfjykldd@foxmail.com'
				item.href = url;
			  } 
			}

			let list3 = body.querySelectorAll('.iframe_mx')
			if(list3.length>0) {
				let body2 = list3[0].contentWindow.document.body; 
				// let item = body2.getElementById('fugai');
				// item.remove();
				let list1 = body2.querySelectorAll('.button2'); 
				for (let index = 0; index < list1.length; index++) {
				  let item = list1[index];
				  var url = item.href; 
				  var str = url.match(/xinxi=.*/);
				  if( str.length>0 && str[0] === 'xinxi=') item.href = url+'lmzxteklmzxtek@gmail.com';
				}
			}
		  }
	}
	//=======================================
	
	// 创建一个滚动容器
	const scrollContainer = GM_addElement(document.body, 'div', {
		id: 'scroll-container',
		class: 'scroll-container'
	})
	scrollContainer.addEventListener('mousedown', press) // 监听鼠标按下操作
	// scrollContainer.addEventListener('touchstart', onTouchStart) // 监听触屏

	// 创建自动向上的按钮
	const scrollUp = GM_addElement(scrollContainer, 'div', {
		id: 'scroll-up',
		class: 'scroll-up'
	})
	// 创建等级显示
	const scrollSpeed = GM_addElement(scrollContainer, 'div', {
		id: 'scroll-speed',
		class: 'scroll-speed',
		textContent: dj
	})
	scrollSpeed.addEventListener('wheel', settingSpeed)
	// 创建自动向下的按钮
	const scrollDown = GM_addElement(scrollContainer, 'div', {
	  id: 'scroll-down',
	  class: 'scroll-down'
	})

	// 设置滚动等级 
	function settingSpeed(e) {
		e.preventDefault()
		if (e.deltaY < 0) defaultDJ += 1
		else defaultDJ -= 1
		if (defaultDJ < 1) defaultDJ = 1;
		if (defaultDJ > 8) defaultDJ = 8;
		scrollSpeed.textContent = defaultDJ
		GM_setValue('dengji', defaultDJ);
	}

	// 按下事件
	function press(e) {
		// 设置只有在速度显示区域才能拖动
		if (e.target.id === 'scroll-speed') {
			// 记录位置
			// pressPosition.top = e.clientY - e.currentTarget.offsetTop
			// pressPosition.left = e.clientX - e.currentTarget.offsetLeft
			// 修改样式显示
			// scrollSpeed.style.cursor = 'move'
			scrollSpeed.style.cursor = 'pointer'
			// 开始监听移动事件
			// document.addEventListener('mousemove', move)
			// document.addEventListener('mouseup', release)

			// document.addEventListener('touchmove', onTouchMove)
			// document.addEventListener('touchend', onTouchEnd)
			// document.addEventListener('touchcancel', onTouchEnd)

			defaultDJ = GM_getValue('dengji'); 
			if(GM_getValue('dengji')) GM_setValue('dengji', defaultDJ); 

			if (document.body !== null) {
				removebodyscript(); 
				removeSweetAlerts(); 
				removeSweetOverlay(); 
			}
			delBodyAttributes(); 			
			set_huijue(); 
		}
		else if (e.target.id === 'scroll-up') {
			defaultDJ += 1; 
			if (defaultDJ < 1) defaultDJ = 1;
			if (defaultDJ > 8) defaultDJ = 8;
			GM_setValue('dengji', defaultDJ);
			scrollSpeed.textContent = defaultDJ
		}
		else if (e.target.id === 'scroll-down') {
			defaultDJ -= 1; 
			if (defaultDJ < 1) defaultDJ = 1;
			if (defaultDJ > 8) defaultDJ = 8;
			GM_setValue('dengji', defaultDJ);
			scrollSpeed.textContent = defaultDJ
		}
	}

    function onTouchStart(e) {
        e.preventDefault && e.preventDefault(), press(e.changedTouches[0]);
    }
    function onTouchMove(e) {
        move(e.changedTouches[0]);
    }
    function onTouchEnd(e) {
        e.preventDefault && e.preventDefault(), release(e.changedTouches[0]);
    }

	// 移动事件
	function move(e) {
		const top = e.clientY - pressPosition.top
		const left = e.clientX - pressPosition.left
		scrollContainer.style.right = `unset`
		scrollContainer.style.top = `${top}px`
		scrollContainer.style.left = `${left}px`
	}

	// 抬起事件
	function release(e) {
		// 修改样式显示
		scrollSpeed.style.cursor = 's-resize'
		// 清除事件
		document.removeEventListener('mousemove', move)
		document.removeEventListener('mouseup', release)
		// document.removeEventListener('touchmove', onTouchMove)
		// document.removeEventListener('touchend', onTouchEnd)
		// document.removeEventListener('touchcancel', onTouchEnd)
	}
	
	showIcon(); 

	// 添加自定义样式
	GM_addStyle(`
    .scroll-container {
      position: fixed;
      top: 88%;
      right: 10px;
      z-index: 99999;
      text-align: center;
      transform: translateY(-50%);
      border-radius: 20px;
      overflow: hidden;
      background-color: rgba(204, 204, 204, 0.4);
      line-height: 40px;
      color: rgba(60, 60, 67, .92);
    }
    .scroll-up,
    .scroll-down {
      width: 40px;
      height: 40px;
      text-align: center;
    }
    .scroll-up::after,
    .scroll-down::after {
      content: '';
      display: inline-block;
      width: 16px;
      height: 16px;
      font-size: 16px;
      box-sizing: border-box;
      border-width: 2px;
      border-style: solid;
    }
    .scroll-up::after {
      transform: rotate(-45deg);
      border-color: rgba(60, 60, 67, .92) rgba(60, 60, 67, .92) transparent transparent;
      margin-top: 14.3425px;
    }
    .scroll-down::after {
      transform: rotate(-45deg);
      border-color: transparent transparent rgba(60, 60, 67, .92) rgba(60, 60, 67, .92);
      margin-top: 8.685px;
    }
    .scroll-up:hover,
    .scroll-down:hover {
      background-color: rgba(204, 204, 204, 0.8);
    }

    .scroll-speed {
      font-size: 18px;
      user-select: none;
      cursor: s-resize;
    }
  `)

})();

